class Solution(object):
    def isRectangleCover(self, rectangles):
        """
        :type rectangles: List[List[int]]
        :rtype: bool
        """
        l, b, r, t = float('inf'), float('inf'), float('-inf'), float('-inf')

        theSum = 0
        for rect in rectangles:
            l = min(l, rect[0])
            b = min(b, rect[1])
            r = max(r, rect[2])
            t = max(t, rect[3])
            theSum += (rect[2] - rect[0]) * (rect[3] - rect[1])

        if theSum != (r - l) * (t - b):
            return False

        # rectangles = sorted(rectangles)
        # widths = [l] * (t - b)
        # for rect in rectangles:
        #     ll, bb, rr, tt = rect
        #     for i in range(bb - b, tt - b):
        #         if widths[i] != ll:
        #             return False
        #         widths[i] = rr


        odd = {(l, b), (l, t), (r, b), (r, t)}
        for rect in rectangles:
            ll, bb, rr, tt = rect
            for p in ((ll, bb), (ll, tt), (rr, bb), (rr, tt)):
                if p in odd:
                    odd.remove(p)
                else:
                    odd.add(p)
        return not bool(odd)


